import PropTypes from 'prop-types';
import '../styles/Navbar.scss'
import Link from 'next/link'

const NavLink = props => (
    <Link href="/nav/[id]" as={`/nav/${props.id}`}>
        <a>{props.children}</a>
    </Link>
)

const Navbar = (props) => (
<div id="nav">
    <a href="#" className="closeBtn" onClick={props.onCloseNav}>
        &times;
    </a>
    <div className="overlay-content">
        <NavLink id="catalogs">Catalogs</NavLink>
        <NavLink id="cars">Cars</NavLink>
        <NavLink id="create-catalog">Create a Catalog</NavLink>
        <NavLink id="create-car">Create a Car</NavLink>
    </div>
</div>
);

Navbar.propTypes = {
    onCloseNav: PropTypes.func
}
export default Navbar;
